import { Heading, Text, Container, Center } from "@chakra-ui/react";

const Skills = () => {
    return (
        <Center bg='blue.600' maxWidth='100%' h='100vh'>
            <Container>
                <Heading as='h2' size='3xl' textAlign='center'>
                    some things i know
                </Heading>
                <Text textAlign='center'>
                </Text>
            </Container>
        </Center>
    )
}

export default Skills
